// @ts-nocheck
import React, { ReactNode, HTMLAttributes } from 'react';
import { createComponent } from '../lib';
import type { JSX } from '@vime/core/dist/types';

import { 
  VmScrubberControl,
  VmSlider,
  VmTooltip 
} from '@vime/core';

import { define } from '../lib';


define('vm-scrubber-control', VmScrubberControl);
define('vm-slider', VmSlider);
define('vm-tooltip', VmTooltip);


export interface ScrubberControlProps extends JSX.VmScrubberControl, HTMLAttributes<HTMLVmScrubberControlElement> {
  children?: ReactNode | ReactNode[]
};

export default createComponent<HTMLVmScrubberControlElement, ScrubberControlProps>(
  'vm-scrubber-control',
  new Set(['alwaysShowHours','hideTooltip','currentTime','duration','noKeyboard','buffering','buffered','i18n']),
);
